B.aIP=A.a(s(["VISADA pavojingosios pakuot\u0117s:","- pakuot\u0117s nuo alyvos bei da\u017e\u0173, lak\u0173, klij\u0173, tirpikli\u0173, ra\u0161alo ir pan. med\u017eiag\u0173, naudojam\u0173 statybos ir remonto darbams;","- metalin\u0117s pakuot\u0117s, kuriose esama pavojing\u0173j\u0173 kiet\u0173 poring\u0173 ri\u0161am\u0173j\u0173 med\u017eiag\u0173 (pvz., asbesto senoje ugniai atsparioje pakuot\u0117s med\u017eiagoje), \u012fskaitant tu\u0161\u010dias susl\u0117gto oro talpyklas;","- visais atvejais prakti\u0161kai tu\u0161\u010dios pakuot\u0117s yra laikomos pavojingosiomis atliekomis, jeigu jose buvo supakuotos sprogiosios, pavojingos sveikatai ar \u016bmaus toksi\u0161kumo med\u017eiagos, ir pa\u017eym\u0117tos atitinkamomis pavojaus piktogramomis.","Kai pakuot\u0117je esama liku\u010di\u0173, kuri\u0173 \u012fprastais b\u016bdais pa\u0161alinti ne\u012fmanoma (pvz., d\u0117l angos dyd\u017eio arba med\u017eiagos pob\u016bd\u017eio), atliekas reik\u0117t\u0173 r\u016b\u0161iuoti ir tvarkyti ne kaip pakuo\u010di\u0173 atliekas, o kaip med\u017eiagos liku\u010di\u0173 atliekas."]),t.s)
B.aIN=A.a(s(["Draud\u017eiama buityje susidaran\u010dias alyv\u0173 bei da\u017e\u0173, lako, ra\u0161alo, klij\u0173, tirpikli\u0173 ir pan. med\u017eiag\u0173, naudojam\u0173 statybos ir remonto darbams, pakuotes bei pakuotes, pa\u017eenklintas pavojaus piktogramomis plauti, skalauti ir i\u0161pilti \u012f kanalizacij\u0105 ar i\u0161mesti \u012f mi\u0161ri\u0173 komunalini\u0173 atliek\u0173 konteinerius.","Prakti\u0161kai tu\u0161\u010dios pakuot\u0117s* nuo skalbikli\u0173, plovikli\u0173, valikli\u0173, \u0161veitikli\u0173, t.y. nuo vis\u0173 t\u0173 buitin\u0117s chemijos produkt\u0173, kurie \u012fprastai naudojant patenka \u012f kanalizacij\u0105, tur\u0117t\u0173 b\u016bti i\u0161naudojami, pagal galimybes, visi\u0161kai ir iki galo. \u0160ias pakuotes rekomenduojama i\u0161valyti ir/arba praskalauti. Pa\u0161alinus pavojing\u0173j\u0173 med\u017eiag\u0173 liku\u010dius, suma\u017einsime pavojing\u0173j\u0173 pakuo\u010di\u0173 kiekius ir tur\u0117sime tik tu\u0161\u010dias pakuotes, kurias bus galima r\u016b\u0161iuoti kaip nepavojing\u0105sias \u012f stiklo, plastiko, popieriaus ir metalo konteinerius.","*Prakti\u0161kai tu\u0161\u010dia pakuot\u0117 \u2013 tai tinkamai i\u0161tu\u0161tinta pakuot\u0117 (be joki\u0173 liku\u010di\u0173, kaip milteli\u0173 liku\u010diai, nuos\u0117dos ir la\u0161ai; i\u0161valyta \u0161epe\u010diu, i\u0161valyta mentele), i\u0161skyrus nei\u0161vengiamus liku\u010dius, netaikant kit\u0173 papildom\u0173 priemoni\u0173 (pvz., toki\u0173 kaip \u0161ildymas). Pakuot\u0117 laikoma tinkamai i\u0161tu\u0161tinta, jeigu v\u0117l bandant j\u0105 tu\u0161tinti, pvz., j\u0105 apvertus, niekas nebela\u0161a arba nebei\u0161krenta kiet\u0173j\u0173 liku\u010di\u0173.",u.A,"15 01 10* \u2013 pakuot\u0117s, kuriose yra pavojing\u0173j\u0173 med\u017eiag\u0173 liku\u010di\u0173 arba kurios yra jomis u\u017eter\u0161tos;","15 01 11* - metalin\u0117s pakuot\u0117s, \u012fskaitant susl\u0117gto oro talpyklas, kuriose yra pavojing\u0173j\u0173 kiet\u0173 poring\u0173 ri\u0161am\u0173j\u0173 med\u017eiag\u0173 (pvz., asbesto)."]),t.s)
